import React from "react";
import Preloader from './../../../assets/images/Double Ring-1s-200px.svg'
import {Col} from "react-bootstrap";

const Preloder = () =>{
    return(
    <Col>
        <img src={Preloader} alt=""/>
    </Col>
    )
}

export default Preloder
